import React from 'react';
import "../styles/topbar.css";

export default function Topbar() {
  return (
    <div className="topbar">
      <h1>Logo</h1>
      <ul className="topbar-list">
        <li className="list-item"><a href="#">Accueil</a></li>
        <li className="list-item"><a href="#">Posts</a></li>
        <li className="list-item"><a href="#">Account</a></li>
      </ul>
      <img src="https://images.pexels.com/photos/3601081/pexels-photo-3601081.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940" alt="blog-image" />
    </div>
  )
}
